<canvas id="q" style="position:fixed; top:0;left:0; width:10vw; height:100vh;"></canvas>
<canvas id="q2" style="position:fixed; top:0;left:90vw; width:10vw; height:100vh;"></canvas>

<script>

var s = window.screen;
var width = q.width = s.width * .1;
var height = q.height = s.height;
var letters = Array(256).join(1).split('');

var draw = function () {
  q.getContext('2d').fillStyle='rgba(0,0,0,.05)';
  q.getContext('2d').fillRect(0,0,width,height);
  q.getContext('2d').fillStyle='#0F0';
  letters.map(function(y_pos, index){
    text = String.fromCharCode(3e4+Math.random()*33);
    x_pos = index * 10;
    q.getContext('2d').fillText(text, x_pos, y_pos);
    letters[index] = (y_pos > 758 + Math.random() * 1e4) ? 0 : y_pos + 10;
  });
};
setInterval(draw, 33);

var s2 = window.screen;
var width2 = q2.width = s2.width * .1;
var height2 = q2.height = s2.height;
var letters2 = Array(256).join(1).split('');

var draw2 = function () {
  q2.getContext('2d').fillStyle='rgba(0,0,0,.05)';
  q2.getContext('2d').fillRect(0,0,width,height);
  q2.getContext('2d').fillStyle='#0F0';
  letters2.map(function(y_pos, index){
    text = String.fromCharCode(3e4+Math.random()*33);
    x_pos = index * 10;
